package lista28_53;

public class Aps46 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int numero = 123;
		int n = numero/100;
		int n1 = numero/10 - n*10;
		int n2 = numero - n*100 - n1*10;
		System.out.println("Numero lido = " + numero);
		System.out.print("Numero gerado = " + n2 + n1 + n);
		
		
		
	}

}
